column5:
professor cade masseys conversational preso style really kept me engaged
    in a way the recited, memorized talk tracks just dont. loved the un case study
    - right up my alley!;

column6:
it would be helpful if the office hours were held on wednesday-friday,
    instead of monday-tuesday when the module homework is due. it leaves little time
    for students to make edits based on the learnings from the office hours.;

column5:
i enjoyed the opportunity to discuss with colleagues in breakout sessions.
    their perceptions of the course broadened the way that i approached the topic.
    that back and forth helped cement ideas.;

the content was incredibly relevant and interesting.; a lot of what
    was covered is never spoken about as leaders round the corner into executive roles.
    thank you for talking about what most programs never speak about - the politics.;
    navigating this space is often very tricky, but with the techniques and discussions
    truly were tremendous to digest and confirm leadership requires work every day.;

i could see myself being implement the strategies and approaches easily
    in real life. this was more actionable than i expected. it will be very useful
    in my next role to have this additional knowledge.;

column6:
instead of linking to books (keep), maybe link to a summary of titles
    used because most recommendations i will have to go back later and explore just
    due to working while taking this course.;

column5:
program structure, introducing the components one by one, then consolidate
    with big picture. the assignments were very effective, making us to think how
    to apply and integrate the techniques.;

first, the flexibility of the program was great which really benefits
    a working executive like myself. the content and education of the videos was very
    impactful. the assignments had real-life application and were not over burdensome.;

i really enjoyed the videos and case studies. applying the learnings
    to real world examples helps me understand the content. the k2 and fire stories
    were especially helpful.;

column6:
i enjoyed the office hours but would have liked more examples on the
    teachings from the instructor. too much time in the breakouts. the breakouts are
    nice but often too long (30 minutes of a 60 minute office hour is too much).;

column5:
the instructors demonstrate impressive knowledge, and their pedagogy
    is excellent. ive thoroughly enjoyed the lectures, especially with the inclusion
    of insightful examples that facilitate understanding.;

the content presented by drs. massey and useem was excellent. the office
    hours were also interesting and i enjoyed the opportunity to connect with other
    leaders from around the world.;

column6:
consider to expand the office hours and go beyond what the professors
    explained in the module video.; i wanted to hear other examples or cases
    beyond the one i already read in the module;

column5:
i loved the modular aspect of the program and the examples of how to
    be a better leader and be more persuasive. there were helpful pointers for quick
    and long-term improvement, which is exactly what i needed.;

the relevance to my current struggles as a leader made this program one
    of the best. learning of different perspectives, and how you can influence others
    has helped me overcome some obstacles i was facing.;

column6:
additional networking events like virtual coffee etc with the cohort,
    and tutors. this should be organised after approximately a month of the completion
    of the course. this would allow us to build a network and reflect on the learnings.;

the program went at a good speed. i did not have any issues. personally
    i had some frustrations when l did not understand the content or some not being
    able to relate from a government perspective.;

column5:
the videos with the examples and the assignment relevance were the best.
    it gave ample scope for self reflection and forced us to truly evaluate our current
    abilities and focus on areas of improvement.;

the quality of instruction was fantastic. it is clear that the professors
    are the tops in their field, and their experience really came through in the course
    content.;
